import { Link } from "react-router-dom";
import './Nav.css'

const Nav = () => {

    return (
        <>
        <nav>
            <div className="navbar-container">
                <Link to="/home">
                    <img src="" alt="Logo Homepage" 
                    />
                </Link>
                <Link to="/home"> Home </Link>
                <Link to="/gallery"> Gallery </Link>
                <Link to="/cutest"> Cutest </Link>
            </div>
        </nav>
        </>
    )
}

export default Nav;
